document.addEventListener('DOMContentLoaded', function() {
	busInit();
});

function busInit(){
		busDatePickerSetUp();
		busAutoCompleteSetUp();
		document.getElementById("busSearchButton").onclick = function() {openBusTabs()};
}

function openBusTabs(){
	var sourceNameText = document.getElementById("busSourceNameText").value;
	
	var destinationNameText = document.getElementById("busDestinationNameText").value;
	
	//format is mm/dd/yyyy
	var departDate = document.getElementById("busDepartDate").value;
	var departDates = departDate.split("/");
	
	var urlArray = busUrls(sourceNameText, destinationNameText, departDates[1], departDates[0], departDates[2]);
	urlOpener(urlArray);
}

function busUrls(sourceNameText, destinationNameText, day, month, year){
  var checkValues = $('input[name=busCheckboxList]:checked').map(function()
            {
                return $(this).val();
            }).get();
					
	for (var count in checkValues) {
		checkValues[count] = String.format(checkValues[count], sourceNameText, destinationNameText, day, month, year);
	}		
		
	return checkValues;
	
}

